INSERT INTO `events` (`id`, `user_id`, `event_category_id`, `added_by`, `name`, `slug`, `start_date`, `end_date`, `start_time`, `end_time`, `location`, `lat`, `long`, `thumbnail_image`, `event_banner`, `description`, `is_visible`, `is_featured`, `total_tickets_sale_count`, `priority`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(13, 1, 5, 'Admin', 'What is the difference between Event Name and Event Title?', 'what-is-the-difference-between-event-name-and-event-title-1tdxo', '2024-01-19', '2024-01-19', '00:00:00', '12:00:00', 'Germany', NULL, NULL, '86', '87', '<p>The information you enter in the Event Name field is what will define your reservation and will appear on room schedules and event calendars. The length of this field is limited to 40 characters.</p><p>When creating a new event, it is best to give it a specific, meaningful, and non-generic name. While the names \"Department Meeting\" or \"Club Meeting\" may be distinguishing enough among your own meetings, such events will be rather impossible to find among all other events named \"Department Meeting\" scheduled by other campus users. Perhaps, \"Biology Department Faculty Meeting\" or \"Browncoats Club Meeting\" would be better.</p><p><br></p><p>You may use the Event Title field to enter additional distinguishing or informative details regarding your event, for example, name of the event series this event is a part of, the title of the movie a club is watching, the title of the talk, or name of the interviewed candidate. This field allows you to enter up to 120 characters, but it is secondary to the Event Name. If you can\'t think of an event title - it is OK to skip this field. There is no need to copy and paste the text from the Event Name field to the Event Title field.</p>', 1, 0, 0, 0, 1, '2024-01-14 16:31:54', '2024-01-18 15:58:01', NULL),
(14, 1, 7, 'Admin', 'Musical Night', 'musical-night-rnrlw', '2024-01-15', '2024-01-17', '00:00:00', '12:00:00', 'Germany', NULL, NULL, '88', '88', '<p>Musical Night<br></p>', 1, 0, 0, 0, 1, '2024-01-15 15:23:35', '2024-01-15 15:23:35', NULL),
