ansparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Compliance with legal obligations</span></p></li></ol><p class=\"MsoNormal\" style=\"box-sizing: border-box; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Poppins, sans-serif; font-size: 12.8px;\"><b style=\"font-weight:normal;\" id=\"docs-internal-guid-1f110d7e-7fff-08ef-bf4a-1b61e949e6b6\"><br></b></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\"><span style=\"font-size:10pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Data Retention</span></p><ol style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:decimal;font-size:10pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:12pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:10pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">We retain personal data for as long as necessary to fulfill the purposes outlined above or as required by law. The retention period may vary depending on the type of data and applicable legal obligations. Once the retention period expires, we will securely delete or anonymize the data to prevent unauthorized access or use.</span></p></li><li dir=\"ltr\" style=\"list-style-type:decimal;font-size:10pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-a