nt:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">We may update this Data Deletion Policy from time to time to reflect changes in our data processing practices. The revised policy will be effective immediately upon posting on our website. We encourage you to review this policy periodically for any updates.</span></p></li></ol><p class=\"MsoNormal\" style=\"box-sizing: border-box; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Poppins, sans-serif; font-size: 12.8px;\"></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:10pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">If you have any questions or concerns regarding our data deletion practices or this policy, please contact us at ask@dogtvfoods.com.</span></p><div><span style=\"font-size:10pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></div>', 'en', '2023-06-26 12:07:39', '2023-06-26 12:16:42', NULL),
